import React from 'react';

const Todo = (props) => {

    return(
        <>
            <div>
                <i onClick={() => {
                    props.onSelect(props.id);
                }} className='close'>* </i>
                <li> {props.text}</li>
            </div>
        </>
    );
};

export default Todo;
